import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expenses = [
    {
      id: "e1",
      title: "Kitchen roll",
      amount: 2.2,
      date: new Date(2020, 7, 14),
    },
    {
      id: "e2",
      title: "pot",
      amount: 20.0,
      date: new Date(2020, 7, 19),
    },
    {
      id: "e3",
      title: "Cutleries",
      amount: 5.00,
      date: new Date(2020, 7, 22),
    },
  ];
  return (
    <div>
      <ExpenseItem  title={expenses[0].title}/>
      <ExpenseItem />
      <ExpenseItem />
    </div>
  );
}

export default App;
